import React from 'react';

const Menu = ({ items, itemName }) => {
  return (
    <div>
      <h2>{itemName} Menu</h2>
      <ul>
        {items.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
};

export default Menu;
